CommonData.BannerCustomCSS:
/* Ajuste para todos os botões do banner de cookies */
#cookie-banner button,
#onetrust-consent-sdk #onetrust-accept-btn-handler,
#onetrust-banner-sdk #onetrust-reject-all-handler,
#onetrust-banner-sdk #onetrust-pc-btn-handler { /* Botão "Preferências de Cookies" */
    background-color: #0073e6; /* Azul padrão */
    color: white; /* Cor do texto */
    border: none; /* Remove borda */
    padding: 14px 24px; /* Ajuste no espaçamento interno */
    font-size: 16px; /* Tamanho da fonte */
    font-weight: bold; /* Negrito */
    text-align: center; /* Centraliza o texto */
    border-radius: 6px; /* Cantos arredondados similar ao botão "Aceitar" */
    cursor: pointer; /* Mostra a "mãozinha" ao passar o mouse */
    width: 100%; /* Mantém a largura uniforme */
    margin-top: 8px; /* Espaço entre os botões */
    transition: background-color 0.3s ease, box-shadow 0.3s ease; /* Efeito suave */
    box-shadow: 0px 2px 4px rgba(20, 46, 82, 0.2); /* Sombra para dar destaque */
}

/* Efeito hover nos botões */
#cookie-banner button:hover,
#onetrust-consent-sdk #onetrust-accept-btn-handler:hover,
#onetrust-banner-sdk #onetrust-reject-all-handler:hover,
#onetrust-banner-sdk #onetrust-pc-btn-handler:hover { /* Botão "Preferências de Cookies" */
    background-color: #005bb5; /* Azul mais escuro no hover */
    box-shadow: 0px 4px 8px rgba(20, 46, 82, 0.3);
}

/* Ajuste específico para o botão "Preferências de Cookies" */
#cookie-banner button#cookie-preferences,
#onetrust-banner-sdk #onetrust-pc-btn-handler {
    background-color: #004a99; /* Azul mais escuro */
    border-radius: 6px; /* Igual ao botão "Aceitar" */
}

/* Efeito hover para o botão "Preferências de Cookies" */
#cookie-banner button#cookie-preferences:hover,
#onetrust-banner-sdk #onetrust-pc-btn-handler:hover {
    background-color: #003366; /* Azul ainda mais escuro no hover */
}

/* Personalização do botão flutuante */
#ot-sdk-btn-floating.ot-floating-button {
    bottom: 50px;
}

/* Ícone do botão flutuante */
.ot-floating-button__front {
    background-image: url("https://optanon.blob.core.windows.net/logos/static/ot_persistent_cookie.png");
}

/* Personalização dos textos no banner */
#onetrust-banner-sdk #onetrust-policy h3 {
    color: #005EB8;
}

/* Estilo de textos no banner */
#onetrust-consent-sdk #onetrust-policy-title,
#onetrust-consent-sdk #onetrust-policy-text,
#onetrust-consent-sdk .ot-b-addl-desc,
#onetrust-consent-sdk .ot-dpd-desc,
#onetrust-consent-sdk .ot-dpd-title,
#onetrust-consent-sdk #onetrust-policy-text *:not(.onetrust-vendors-list-handler),
#onetrust-consent-sdk .ot-dpd-desc *:not(.onetrust-vendors-list-handler),
#onetrust-consent-sdk #onetrust-banner-sdk #banner-options *,
#onetrust-banner-sdk .ot-cat-header {
    color: #617385;
}

/* Links no banner */
#onetrust-consent-sdk #onetrust-banner-sdk a[href],
#onetrust-consent-sdk #onetrust-banner-sdk a[href] font,
#onetrust-consent-sdk #onetrust-banner-sdk .ot-link-btn {
    color: #40bbff;
    margin-left: 8px;
}

/* Estilização do banner */
#onetrust-consent-sdk #onetrust-banner-sdk {
    background-color: #fff;
    border-radius: 8px;
    box-shadow: 0px 8px 12px rgba(20, 46, 82, 0.2);
    border: 1px solid #e8edf1;
}

/* Botões dentro do banner */
#onetrust-consent-sdk #onetrust-accept-btn-handler,
#onetrust-banner-sdk #onetrust-reject-all-handler,
#onetrust-banner-sdk #onetrust-pc-btn-handler { /* Incluído para manter a padronização */
    font-family: Lato, sans-serif;
    font-style: normal;
    font-weight: normal;
    font-size: 16px;
    line-height: 23px;
    color: #ffffff;
    background: #005eb8;
    box-shadow: 0px 2px 4px rgba(20, 46, 82, 0.2);
    border-radius: 6px; /* Aplicando o arredondamento correto */
    border: none;
    letter-spacing: -0.01em;
}
